<template>
    <view class="ai-icon">
        <text
            v-if="!isImage"
            :class="['ai-icon__text', 'ai-icon-' + name, customClass]"
            :style="[iconStyle, $util.addStyle(customStyle)]"
            >{{ icon }}</text
        >
        <image
            v-else
            :class="['ai-icon__image', customClass]"
            :src="name"
            :style="[imageStyle, $util.addStyle(customStyle)]"
        />
    </view>
</template>

<script>
import mixins from '@/aiui/mixins/mixins';
import { icons } from '@/aiui/components/ai-icon/ai-icon.js';
// #ifdef APP-NVUE
// nvue通过weex的dom模块引入字体
const fontUrl = `${uni.$config.static}font/ai-icon.ttf`;
const domModule = weex.requireModule('dom');
domModule.addRule('fontFace', {
    fontFamily: 'ai-icon',
    src: `url('${fontUrl}')`,
});
// #endif

export default {
    name: 'AiIcon',
    mixins: [mixins],
    props: {
        // 图标名称或图片地址
        name: {
            type: String,
            default: '',
        },
        // 图标颜色
        color: {
            type: String,
            default: uni.$config['color-default'],
        },
        // 图标大小
        size: {
            type: [String, Number],
            default: uni.$config['font-size-normal'],
        },
    },
    computed: {
        // 通过图标名，查找对应的图标
        icon() {
            // 如果内置的图标中找不到对应的图标，就直接返回name值，因为用户可能传入的是unicode代码
            return icons['ai-icon-' + this.name] || this.name;
        },
        // 判断传入的name属性，是否图片路径，只要带有"/"均认为是图片形式
        isImage() {
            return this.name.indexOf('/') !== -1;
        },
        iconStyle() {
            let style = {};
            const size = uni.$config[`font-size-${this.size}`] || this.size;
            if (size) {
                style.fontSize = uni.$util.addUnit(size);
                style.lineHeight = uni.$util.addUnit(size);
            }
            const color = uni.$config[`color-${this.color}`] || this.color;
            if (color) {
                style.color = color;
            }
            return style;
        },
        imageStyle() {
            let style = {};
            const size = uni.$config[`font-size-${this.size}`] || this.size;
            if (size) {
                style.width = uni.$util.addUnit(size);
                style.height = uni.$util.addUnit(size);
            }
            return style;
        },
    },
};
</script>

<style lang="scss" scoped>
$ai-icon-size: $font-size-normal !default;
$ai-icon-color: $color-default !default;

/* #ifndef APP-NVUE */
// 非nvue下加载字体
@font-face {
    font-family: 'ai-icon';
    src: url('data:application/x-font-woff2;charset=utf-8;base64,');
}
/* #endif */
.ai-icon {
    display: flex;
    flex-direction: row;
    align-items: center;

    &__text {
        display: flex;
        flex-direction: row;
        align-items: center;
        font-family: 'ai-icon';
        font-size: $ai-icon-size;
        line-height: $ai-icon-size;
        color: $ai-icon-color;
    }

    &__image {
        width: $ai-icon-size;
        height: $ai-icon-size;
        /* #ifndef APP-NVUE */
        will-change: transform;
        /* #endif */
    }
}
</style>
